import React, {useState} from 'react'
import Modal from './Modal'


const Navbar = () => {

   const [estadoModal1, cambiarEstadoModal1] = useState(false);

return(
<>
  
<nav className="navbar navbar-dark bg-dark "> 
<div className="container ">
<a className="navbar-brand" href="/"><h3>Muro interactivo -BTS-</h3></a>
  <div className="d-grid gap-2 d-md-flex justify-content-md-end">
<button className="btn btn-outline-light me-md-2" type="button" >Iniciar secion</button>
<button className="btn btn-outline-light" type="button" onClick={() => cambiarEstadoModal1(!estadoModal1)}><i className="material-icons">add</i>
</button>

<Modal
  estado= {estadoModal1}
  cambiarEstado={cambiarEstadoModal1}
>

  </Modal>
</div>
 </div>
</nav>
</>

)
}

export default Navbar;
